import React, { useState } from 'react';
import { 
  Box, 
  Button, 
  TextField, 
  Typography, 
  Paper, 
  Divider, 
  CircularProgress,
  Alert,
  Accordion,
  AccordionSummary,
  AccordionDetails,
  List,
  ListItem,
  ListItemText,
  Chip
} from '@mui/material';
import ExpandMoreIcon from '@mui/icons-material/ExpandMore';
import { runAllApiTests, testApiKeyAuth, testTemplateOperations } from '../utils/apiTest';

const ApiTester = () => {
  const [businessId, setBusinessId] = useState('');
  const [apiKey, setApiKey] = useState('');
  const [isLoading, setIsLoading] = useState(false);
  const [testResults, setTestResults] = useState(null);
  const [error, setError] = useState('');
  const [success, setSuccess] = useState('');

  const handleRunTests = async () => {
    if (!businessId || !apiKey) {
      setError('Business ID and API Key are required');
      return;
    }

    setIsLoading(true);
    setError('');
    setSuccess('');
    setTestResults(null);

    try {
      const results = await runAllApiTests(businessId, apiKey);
      setTestResults(results);
      
      if (results.success) {
        setSuccess('All tests passed successfully!');
      } else {
        setError('Some tests failed. Check the results for details.');
      }
    } catch (err) {
      setError(`Error running tests: ${err.message}`);
    } finally {
      setIsLoading(false);
    }
  };

  const handleTestAuth = async () => {
    if (!businessId || !apiKey) {
      setError('Business ID and API Key are required');
      return;
    }
    
    setIsLoading(true);
    setError('');
    setSuccess('');
    setTestResults([]);
    
    try {
      // Test with direct fetch to validate-credentials endpoint
      const response = await fetch(`/businesses/validate-credentials?business_id=${businessId}`, {
        method: 'GET',
        headers: {
          'Content-Type': 'application/json',
          'Accept': 'application/json',
          'Authorization': `Bearer ${apiKey}`
        },
        credentials: 'include'
      });
      
      const status = response.status;
      const data = await response.json().catch(() => ({}));
      
      const result = {
        test: 'Authentication',
        status,
        data,
        success: response.ok
      };
      
      setTestResults([result]);
      
      if (response.ok) {
        setSuccess('Authentication successful!');
      } else {
        setError(`Authentication failed: ${status} ${data.message || ''}`);
      }
    } catch (err) {
      console.error('Authentication test error:', err);
      setError(`Authentication test error: ${err.message}`);
      setTestResults([{
        test: 'Authentication',
        error: err.message,
        success: false
      }]);
    } finally {
      setIsLoading(false);
    }
  };

  const handleTestTemplates = async () => {
    if (!businessId || !apiKey) {
      setError('Business ID and API Key are required');
      return;
    }
    
    setIsLoading(true);
    setError('');
    setSuccess('');
    setTestResults([]);
    
    try {
      // Test with direct fetch to templates endpoint
      const response = await fetch(`/templates/?business_id=${businessId}`, {
        method: 'GET',
        headers: {
          'Content-Type': 'application/json',
          'Accept': 'application/json',
          'Authorization': `Bearer ${apiKey}`
        },
        credentials: 'include'
      });
      
      const status = response.status;
      const data = await response.json().catch(() => ({}));
      
      const result = {
        test: 'Templates',
        status,
        data,
        success: response.ok
      };
      
      setTestResults([result]);
      
      if (response.ok) {
        setSuccess('Templates fetched successfully!');
      } else {
        setError(`Templates fetch failed: ${status} ${data.message || ''}`);
      }
    } catch (err) {
      console.error('Templates test error:', err);
      setError(`Templates test error: ${err.message}`);
      setTestResults([{
        test: 'Templates',
        error: err.message,
        success: false
      }]);
    } finally {
      setIsLoading(false);
    }
  };

  const renderTestResults = () => {
    if (!testResults) return null;

    return (
      <Box sx={{ mt: 3 }}>
        <Typography variant="h6" gutterBottom>Test Results</Typography>
        
        {testResults.authResult && (
          <Accordion defaultExpanded>
            <AccordionSummary expandIcon={<ExpandMoreIcon />}>
              <Typography>Authentication Test Results</Typography>
            </AccordionSummary>
            <AccordionDetails>
              <List>
                {testResults.authResult.results.map((result, index) => (
                  <ListItem key={index} divider>
                    <ListItemText
                      primary={
                        <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                          <Typography variant="subtitle1">
                            {Object.keys(result.headers)[0]}
                          </Typography>
                          <Chip 
                            label={result.success ? 'Success' : 'Failed'} 
                            color={result.success ? 'success' : 'error'} 
                            size="small" 
                          />
                        </Box>
                      }
                      secondary={
                        <Box>
                          <Typography variant="body2">
                            Status: {result.status || 'N/A'}
                          </Typography>
                          {result.data && (
                            <Typography variant="body2">
                              Response: {JSON.stringify(result.data)}
                            </Typography>
                          )}
                          {result.error && (
                            <Typography variant="body2" color="error">
                              Error: {result.error}
                            </Typography>
                          )}
                        </Box>
                      }
                    />
                  </ListItem>
                ))}
              </List>
            </AccordionDetails>
          </Accordion>
        )}
        
        {testResults.templateResult && (
          <Accordion defaultExpanded>
            <AccordionSummary expandIcon={<ExpandMoreIcon />}>
              <Typography>Template Operations Test Results</Typography>
            </AccordionSummary>
            <AccordionDetails>
              <Typography variant="subtitle1" gutterBottom>Fetch Templates</Typography>
              <Box sx={{ mb: 2 }}>
                <Typography variant="body2">
                  Status: {testResults.templateResult.fetchResult.status || 'N/A'}
                </Typography>
                <Chip 
                  label={testResults.templateResult.fetchResult.success ? 'Success' : 'Failed'} 
                  color={testResults.templateResult.fetchResult.success ? 'success' : 'error'} 
                  size="small" 
                  sx={{ mt: 1 }}
                />
                {testResults.templateResult.fetchResult.data && (
                  <Typography variant="body2" sx={{ mt: 1 }}>
                    Response: {JSON.stringify(testResults.templateResult.fetchResult.data)}
                  </Typography>
                )}
                {testResults.templateResult.fetchResult.error && (
                  <Typography variant="body2" color="error" sx={{ mt: 1 }}>
                    Error: {testResults.templateResult.fetchResult.error}
                  </Typography>
                )}
              </Box>
              
              <Divider sx={{ my: 2 }} />
              
              <Typography variant="subtitle1" gutterBottom>Create Template</Typography>
              <Box>
                <Typography variant="body2">
                  Status: {testResults.templateResult.createResult.status || 'N/A'}
                </Typography>
                <Chip 
                  label={testResults.templateResult.createResult.success ? 'Success' : 'Failed'} 
                  color={testResults.templateResult.createResult.success ? 'success' : 'error'} 
                  size="small" 
                  sx={{ mt: 1 }}
                />
                {testResults.templateResult.createResult.data && (
                  <Typography variant="body2" sx={{ mt: 1 }}>
                    Response: {JSON.stringify(testResults.templateResult.createResult.data)}
                  </Typography>
                )}
                {testResults.templateResult.createResult.error && (
                  <Typography variant="body2" color="error" sx={{ mt: 1 }}>
                    Error: {testResults.templateResult.createResult.error}
                  </Typography>
                )}
              </Box>
            </AccordionDetails>
          </Accordion>
        )}
      </Box>
    );
  };

  return (
    <Paper sx={{ p: 3, maxWidth: 800, mx: 'auto', mt: 4 }}>
      <Typography variant="h5" gutterBottom>API Tester</Typography>
      <Typography variant="body1" paragraph>
        Use this tool to test API connectivity and authentication. Enter your Business ID and API Key below.
      </Typography>
      
      {error && (
        <Alert severity="error" sx={{ mb: 2 }} onClose={() => setError('')}>
          {error}
        </Alert>
      )}
      
      {success && (
        <Alert severity="success" sx={{ mb: 2 }} onClose={() => setSuccess('')}>
          {success}
        </Alert>
      )}
      
      <Box sx={{ mb: 3 }}>
        <TextField
          fullWidth
          label="Business ID"
          value={businessId}
          onChange={(e) => setBusinessId(e.target.value)}
          margin="normal"
          required
        />
        <TextField
          fullWidth
          label="API Key"
          value={apiKey}
          onChange={(e) => setApiKey(e.target.value)}
          margin="normal"
          required
          type="password"
        />
      </Box>
      
      <Box sx={{ display: 'flex', gap: 2, mb: 3 }}>
        <Button 
          variant="contained" 
          onClick={handleRunTests} 
          disabled={isLoading}
          startIcon={isLoading ? <CircularProgress size={20} /> : null}
        >
          Run All Tests
        </Button>
        <Button 
          variant="outlined" 
          onClick={handleTestAuth} 
          disabled={isLoading}
        >
          Test Authentication
        </Button>
        <Button 
          variant="outlined" 
          onClick={handleTestTemplates} 
          disabled={isLoading}
        >
          Test Templates
        </Button>
      </Box>
      
      {renderTestResults()}
    </Paper>
  );
};

export default ApiTester;
